import React from "react";



const Forecast = (weather) => {

    return (
        <div>
            <div class="container">
                <div class="row">
                    {weather.item[0].split("T")[1]}: {weather[1]} F
                </div>
            </div>
        </div>
    );

    
}

export default Forecast;
